(21, 'Aster Hospital', 'Aster Hospital', 1, '343444444', '13-10-2022', '<p>One trusted brand, four great locations &ndash;</p>\r\n<p>Al Mankhool, Al Qusais, Jebel Ali, Muhaisnah.</p>\r\n<p>Aster Hospitals, Dubai is an extension of Aster DM Healthcare&rsquo;s applaudable efforts to provide world-class, patient-centric hospitals radicalized by technological and medical advancements while constantly inculcating a culture of perfection.</p>\r\n<p>Everything at Aster Hospitals, Dubai is designed ergonomically. Patient comfort and satisfaction are of the utmost importance and we deliver that with serene surroundings, spacious interiors, and highly-advanced facilities to create a positive environment conducive to healing.</p>', '/uploadFiles/logo/1661598775.png', '<p>9 A Street, Al Qusais Industrial Area 2, Al Qusais,</p>', 230, 90, 72, '636304', 'Ram', 'Manager', 'ram@mail.com', '+9180569604', '+91808659632', '30,37,29', '1233', 'Bank of Dubai', '122323', 'IB', '12222222', 1, 'sakthio@mail.com', 'sakthi', NULL, 1, 'uploadFiles/firm/gallery/p4aBAfqb6yYls6oO6t39Vf6JghRSjL05ZFZgJJjJ.jpg,uploadFiles/firm/gallery/R3NsUgZ5xuLhc4ZLKIxsM1sahyOEUPg0sunkIUYD.jpg,uploadFiles/firm/gallery/6nOFn0lui9yjK1nndReCP9WyYSJNBmcu3vSsQqGz.jpg', '2022-11-10 02:19:01', '2022-10-13 10:29:28', 1, '[{\"sunday_from\":\"09:30\",\"sunday_to\":\"20:30\",\"day\":\"sunday\"}]', '[]', '[]', '[]', '[]', '[]', '[]', 2, NULL, '0', '1'),
(22, 'MERLYN LAW FIRM', 'MERLYN GROUP OF COMPANY', 1, '4444', '13-10-2022', '<p>India&rsquo;s Leading Law Firm</p>\r\n<p>We aim to deliver exceptional yet affordable legal services in Criminal Law, Family &amp; Divorce Law, Civil Litigation, Real Estate Law, Medical Law, Sports Law, Immigration &amp; Employment Laws.</p>', '/uploadFiles/logo/1661142214.png', '<p>No:323, Thambu Chetty Street, Room No.24, III Floor, LIC Andhra Insurance Building</p>', 100, 85, 64, '653232', 'Madhan', 'CEO', 'madhan@gmail.com', '+9184565461', '+91545454', '34,35', '12345', 'rasers', 'sdfs', 'sdfs', 'sdfs', NULL, '07sdhfskj@gskl.com', 'raskjd', NULL, NULL, 'uploadFiles/firm/gallery/KvpUhrsyltqO1ymv2vAOTYwbBlblpSlF1uEjI6BO.jpg', '2022-11-10 02:21:51', '2022-10-13 12:57:00', 1, '[{\"sunday_from\":\"18:25\",\"sunday_to\":\"23:25\",\"day\":\"sunday\"}]', '[]', '[]', '[]', '[]', '[]', '[]', 2, NULL, '0', '1'),
(24, 'Neuro Foundation Hospital', 'Neuro Foundation Hospital pvt Ltd', 1, '12', '15-10-2022', '<p>To enable early easy and sure access to state of the art comprehensive treatment methods in Neurology, Neurosurgery and Mental health to every needy person with Neurological illness, round the clock.</p>', '/uploadFiles/logo/sample.jpg', '<p>Three Roads, Meyyanur Main Rd, Salem, Tamil Nadu 636009</p>', 100, 85, 65, '636009', 'Ramesh', 'nero', 'dskdjf@gmail.com', '+91', '+91', '30,37,29', '1111', '11', '11', '11', 'Salem', NULL, '07sdhskj@gskl.com', 'raskjd', NULL, NULL, 'uploadFiles/firm/gallery/83EEtk2epH9MKol9zmpZtOADR1pCMJGzwQ7Kv0ac.jpg,uploadFiles/firm/gallery/s5pKI55PgMQVaQjfcUJafcRSiVTDrmgFGGO7QyVy.jpg,uploadFiles/firm/gallery/zLAN0A5Ve8OOrAgcvryId7DcMR0vx0vjxVRNZpPR.jpg', '2022-11-10 02:21:51', '2022-10-15 07:38:36', 1, '[{\"sunday_from\":\"13:07\",\"sunday_to\":\"02:08\",\"day\":\"sunday\"}]', '[]', '[]', '[]', '[]', '[]', '[]', 2, NULL, '0', '1'),
